def cap3(inputContig, vvFolder):
    # directory w/ results
    if not os.path.exists(vvFolder):
      os.makedirs(vvFolder)

    # copy original fasta in result directory
    copy_command = ["cp", os.path.normpath(inputContig), os.path.normpath(vvFolder)]
    subprocess.run(copy_command, check=True)

    for cpContig in os.listdir(vvFolder):
      if cpContig.endswith(".fasta" or ".fa"):
        # run CAP3
        cap3_command = ["cap3", os.path.join(vvFolder,cpContig)]
        subprocess.run(cap3_command, check=True)
      if not os.path.exists(vvFolder):
        print("####### Fasta file not found")

    for contigs in os.listdir(vvFolder):
        if contigs.endswith(".cap.contigs"):
            sample = contigs.replace(".fasta.cap.contigs","")
            print(f"####### Assembling sample {sample} with CAP3")

            for singlets in os.listdir(vvFolder):
                if singlets.endswith(".cap.singlets"):

                    cat_command = f"cat {os.path.join(vvFolder,contigs)} {os.path.join(vvFolder,singlets)} >> {os.path.join(vvFolder, f'{sample}_CAP3.fasta')}"
                    print(cat_command)
                    subprocess.run(cat_command, shell=True, check=True)
                    # merge the outputs of cap3
                else:
                    print("####### Error executing CAP3 on fasta file")
    
    log_files = [os.path.join(vvFolder, file) for file in os.listdir(vvFolder)
                 if file.endswith((".links",".qual",".info",".contigs",".singlets",".ace"))]
    for log_file in log_files:
        os.remove(log_file)
    # remove original fasta file
    os.remove(os.path.join(vvFolder,inputContig))


def renameFasta(vvFolder):

    for fasta in os.listdir(vvFolder):
        if fasta.endswith(".fasta"):
            input_fasta = os.path.join(vvFolder, fasta)
    mod_headers = []

    for i, record in enumerate(SeqIO.parse(input_fasta, "fasta"), start=1):
        # Mod header
        new_id = f"contig_{i:02d}"
        record.id = new_id
        record.description = new_id 

        # Add header
        mod_headers.append(record)

    fastafile = os.path.join
    # Writing in fasta
    with open(input_fasta, "w") as output_handle:
        SeqIO.write(mod_headers, output_handle, "fasta")


def diamondTable(viralDB, vvFolder, CPU):
    # debugs
    if not os.path.exists(vvFolder):
        raise FileNotFoundError(f"Directory {vvFolder} doesn't exist.")

    for inputContig in os.listdir(vvFolder):
        if inputContig.endswith("_CAP3.fasta"):
            sample = inputContig.replace("_CAP3.fasta", "")

            command_dmnd = f"diamond blastx -d {viralDB} -q {os.path.join(vvFolder, inputContig)} --threads {CPU} --outfmt 6 qseqid sseqid qlen slen pident evalue qcovhsp stitle full_qseq --max-target-seqs 1 --out {os.path.join(vvFolder, sample + '_diamond.tsv')}"
            
            # run diamond
            try:
                subprocess.run(command_dmnd, shell=True, check=True)
                print(f"Processado: {sample}")
            except subprocess.CalledProcessError as e:
                print(f"Erro ao processar {sample}: {e}")



def processDmndOut(vvFolder):
    os.makedirs(os.path.join(vvFolder, "hit_tables"))

    for table in os.listdir(vvFolder):
        if table.endswith("_diamond.tsv"):
            sample = table.replace('_diamond.tsv', '_ViralDmnd.tsv')

            entrada = os.path.join(vvFolder, table)
            saida = os.path.join(vvFolder, sample)
            
            # replace w/ sed - important
            sed_com = f"sed 's/\\[/\\t/g; s/\\]//g' {entrada}"
            
            # headers of table
            newcols = "QueryID\tSubjectID\tQseqLength\tSseqLength\tPident\tEvalue\tQCover\tSubjTitle\tOrganism_Name\tFullQueryLength\n"
            # QueryID

            try:
                # run sed
                result = subprocess.run(sed_com, shell=True, check=True, capture_output=True, text=True)
                
                # write headers in final table
                with open(saida, 'w') as out_file:
                    out_file.write(newcols)
                    out_file.write(result.stdout)
                
                # move original table
                mydir = "hit_tables"
                move_table = f"mv {os.path.normpath(entrada)} {str(os.path.join(vvFolder, mydir))}"
                subprocess.run(move_table, shell=True, check=True)

            except subprocess.CalledProcessError as e:
                print(f"Error in process file {entrada}: {e}")
            except Exception as e:
                print(f"Unexpected error in process file {entrada}: {e}")

