# load json
json_data = json.loads(json_viral)
viral_metadata = pd.DataFrame(json_data)


def viralFilter(vvFolder):

  dmnd_files = glob.glob(os.path.join(vvFolder, "*_ViralDmnd.tsv"))
  single_file = dmnd_files[0]

  #file_path = os.path.join(vvFolder, "*_ViralDmnd.tsv")
  #dmnd_files = glob.glob(file_path)

  if not dmnd_files:
    raise FileNotFoundError(f"No file in: {single_file}")

  
  file = pd.read_csv(single_file, sep="\t",on_bad_lines='skip')

  # operao de juno
  file = pd.merge(file, viral_metadata, on="Organism_Name", how="left")

  # ordem das colunas
  outrasCols = list(set(file.columns) - {"Genome.composition"})
  file = file[["QueryID", "SubjectID", "QseqLength", "SseqLength", "Pident", "Evalue", "QCover",
  "SubjTitle", "Organism_Name", "Family", "Genome.composition", "FullQueryLength"]]

  # Filtro de sequencias
  file = file[file["QseqLength"] >= 500]

  # Remover duplicatas
  file = file.drop_duplicates()
  # Obter o nome base do arquivo de entrada
  inputBasename = os.path.basename(single_file)
  # Caminho do arquivo de sada
  reduc_name = inputBasename.replace("_ViralDmnd.tsv", "")
  output_file = os.path.join(vvFolder, f"{reduc_name}_ViralProspect.tsv")
    
  # Escreva os dados em um arquivo de sada dentro do diretrio criado  
  file.to_csv(output_file, sep="\t", index=False)

  # Create fasta viral file
  output_pre = os.path.join(vvFolder, f"{reduc_name}_pre.tsv")
  arquivo_PRE = file[["QueryID", "FullQueryLength"]]
  arquivo_PRE.to_csv(output_pre, sep="\t", index=False)

  samp = os.path.basename(output_pre).replace("_pre.tsv", "")
  with open(output_pre, "r") as infile, open(f"{vvFolder}/{samp}_ViralProspect.fasta", "w") as outfile:
    lines = infile.readlines()
    for line in lines[1:]:  # Ignorar a primeira linha
      line = line.strip().replace('\t', '\n')
      outfile.write(f">{line}\n")
    
  os.remove(output_pre)
  os.remove(single_file)


def findorf(vvFolder):
    
    fileFasta = os.path.join(vvFolder, "*_ViralProspect.fasta")
    viral_files = glob.glob(fileFasta)

    for viral_file in viral_files:
        entrada = viral_file
        nome = os.path.basename(viral_file).replace("_ViralProspect.fasta", "")
        saida = vvFolder

        # Executa orfipy - genetic code 01
        orfipy = ["orfipy","--partial-3","--partial-5","--table", "1", "--outdir", saida, entrada, "--pep", f"{nome}_ORFs.fasta"]

        subprocess.run(orfipy, check=True)

        # Remove arquivos .log
        log_files = [os.path.join(vvFolder, file) for file in os.listdir(vvFolder) if file.endswith(".log")]
        for log_file in log_files:
            os.remove(log_file)

    fileFasta = os.path.join(vvFolder, "*_CAP3.fasta")
    viral_files = glob.glob(fileFasta)

    for viral_file in viral_files:
        entrada = viral_file
        nome = os.path.basename(viral_file).replace("_CAP3.fasta", "")
        saida = vvFolder

        # Executa orfipy - genetic code 01
        orfipy = ["orfipy","--partial-3","--partial-5","--table", "1", "--outdir", saida, entrada, "--pep", f"{nome}_all_ORFs.fasta"]

        subprocess.run(orfipy, check=True)

        # Remove arquivos .log
        log_files = [os.path.join(vvFolder, file) for file in os.listdir(vvFolder) if file.endswith(".log")]
        for log_file in log_files:
            os.remove(log_file)



def ORFs(vvFolder, numORF):
    
    orfs_dict = defaultdict(list)

    # read files
    for fasta in os.listdir(vvFolder):
        if fasta.endswith("_ORFs.fasta"):
            input_fasta = fasta[0]
            input_fasta = os.path.join(vvFolder, fasta)


    for record in SeqIO.parse(input_fasta, "fasta"):
        header = record.description
        contig = header.split(".")[0]  # get the first part of description
        orfs_dict[contig].append(record)

    
    biggest_orfs = []

    # process each contig
    for contig, orfs in orfs_dict.items():
        # sorting
        orfs.sort(key=lambda x: len(x.seq), reverse=True)
        # select biggest orfs
        biggest_orfs.extend(orfs[:int(numORF)])

    # write new fasta w/ biggest orfs
    with open(input_fasta, "w") as output_handle:
        SeqIO.write(biggest_orfs, output_handle, "fasta")
    ###########################################################################
    # All ORFs

    for fasta in os.listdir(vvFolder):
        if fasta.endswith("_all_ORFs.fasta"):
            input_fasta = fasta[0]
            input_fasta = os.path.join(vvFolder, fasta)


    for record in SeqIO.parse(input_fasta, "fasta"):
        header = record.description
        contig = header.split(".")[0]  # get the first part of description
        orfs_dict[contig].append(record)

    
    biggest_orfs = []

    # process each contig
    for contig, orfs in orfs_dict.items():
        # sorting
        orfs.sort(key=lambda x: len(x.seq), reverse=True)
        # select biggest orfs
        biggest_orfs.extend(orfs[:int(numORF)])

    # write new fasta w/ biggest orfs
    with open(input_fasta, "w") as output_handle:
        SeqIO.write(biggest_orfs, output_handle, "fasta")


