def diamond_blastx(vvFolder, database, CPU, diamond_path):

    fileFasta = os.path.join(vvFolder, "*_ViralProspect.fasta")
    viral_files = glob.glob(fileFasta)

    for viral_file in viral_files:
        infile = viral_file
        sample = os.path.basename(viral_file).replace("_ViralProspect.fasta", "")
        outfile = os.path.join(vvFolder,sample)

        if diamond_path == "None":

          Dblastx_input = [
          "diamond", "blastx",
          "--db", database,
          "--query", infile,
          "--threads", str(CPU),
          "--outfmt", "6", "qseqid", "qlen", "slen", "qcovhsp", "pident", "evalue", "stitle",
          "--max-target-seqs", "1",
          "--out", f"{outfile}_blastx.tsv"
          ]
          print("##### Diamond BLASTx started!")

          try:
              # Executa o comando com subprocess.run
              subprocess.run(Dblastx_input, check=True, capture_output=True, text=True)
        
          except subprocess.CalledProcessError as e:
              # Captura e exibe informaes sobre o erro
              print(f"Error: Diamond BLASTx failed with return code {e.returncode}.")
              print(f"Command output: {e.stdout}")
              print(f"Command error: {e.stderr}")


        else:
          Dblastx_input = [
          diamond_path, "blastx",
          "--db", database,
          "--query", infile,
          "--threads", str(CPU),
          "--outfmt", "6", "qseqid", "qcovhsp", "pident", "evalue", "stitle",
          "--max-target-seqs", "1",
          "--out", f"{outfile}_blastx.tsv"
          ]

          print("##### Diamond BLASTx started!")
          subprocess.run(Dblastx_input, check=True, capture_output=True, text=True)
        

# Funo para extrair o nome da espcie
def extract_organism_name(stitle):
    if stitle == "no_hits":
        return ""
    match = re.search(r'\[([^\]]+)\]', stitle)  # Captura texto dentro dos colchetes
    if match:
        return match.group(1)  # Retorna o nome da espcie
    return ""  # Retorna vazio caso no haja nome da espcie



